"""
205. 同构字符串

给定两个字符串 s 和 t ，判断它们是否是同构的。

如果 s 中的字符可以按某种映射关系替换得到 t ，那么这两个字符串是同构的。

每个出现的字符都应当映射到另一个字符，同时不改变字符的顺序。不同字符不能映射到同一个字符上，相同字符只能映射到同一个字符上，字符可以映射到自己本身。



示例 1:

输入：s = "egg", t = "add"
输出：true

示例 2：

输入：s = "foo", t = "bar"
输出：false

示例 3：

输入：s = "paper", t = "title"
输出：true



提示：

    1 <= s.length <= 5 * 104
    t.length == s.length
    s 和 t 由任意有效的 ASCII 字符组成


"""
from leetcode.costTime import cost_time


class Solution:
    @cost_time
    def isIsomorphic(self, s: str, t: str) -> bool:
        # counter_s,counter_t=collections.Counter(s),collections.Counter(t)
        # print(len(list(counter_s))==len(list(counter_t)))
        # print(list(counter_s))
        # print(list(counter_t))
        # print(list(counter_s.values())==list(counter_t.values()))
        # print(list(counter_s.values()))
        # print(list(counter_t.values()))
        # return list(counter_s.values())==list(counter_t.values()) and len(list(counter_s))==len(list(counter_t))
        dic = {}
        for i in range(len(s)):
            if s[i] in dic.keys():
                if t[i] != dic[s[i]]:
                    return False
                # else:
                #     continue
            elif t[i] in dic.values():
                return False
            else:
                dic[s[i]] = t[i]
        return True

    @cost_time
    def isIsomorphicOffice(self, s: str, t: str) -> bool:
        s2t, t2s = {}, {}
        for a, b in zip(s, t):
            # 对于已有映射 a -> s2t[a]，若和当前字符映射 a -> b 不匹配，
            # 说明有一对多的映射关系，则返回 false ；
            # 对于映射 b -> a 也同理
            if a in s2t and s2t[a] != b or \
                    b in t2s and t2s[b] != a:
                return False
            s2t[a], t2s[b] = b, a
        return True


